ShopifyAPI.updateCart = function (cartUpdates, callback) {
  var items = CartJS.cart.items;
  var keys = Object.keys(cartUpdates);
  var cartJSUpdates = []; // console.log(cartUpdates);

  var updated = false;
  var add = [];

  for (var i = 0; i < keys.length; i++) {
    var found = false;
    var id = parseInt(keys[i]);
    var quantity = parseInt(cartUpdates[id]);
    var timer = 1000;

    for (var j = 0; j < items.length; j++) {
      if (items[j].id == id) {
        found = true;
      }

      if (items[j].id == id && items[j].quantity != quantity && !updated) {
        // console.log("updateItem", items, j + 1, quantity);
        CartJS.updateItem(j + 1, quantity);
        updated = true;
      }
    }

    if (!found) {
      add.push({
        id: id,
        quantity: quantity
      });
    }
  }

  for (var i = 0; i < add.length; i++) {
    CartJS.addItem(add[i].id, add[i].quantity);
  }
};

